from grid import gridsource as grid

puzzleinput = """



"""

keypad = [
    [1,2,3],
    [4,5,6],
    [7,8,9]
]

def clamp(lo, hi, n):
    return max(min(n, hi), lo)
def clampvec(v):
    return tuple(clamp(0, 2, x) for x in v)

pos = (1, 1)
ans = ''
for line in puzzleinput.split('\n'):
    line = line.strip()
    for c in line:
        v = grid.tovec[c]
        pos = grid.addvec(pos, v)
        pos = clampvec(pos)
    ans += str(grid.index(keypad, pos))


if '48584' == ans:
    print('OK', __file__)
else:
    print('FAILED', __file__)
